import { combineReducers } from "redux";
import SelectMenu from "./MiddleMenuSelect";
import SelectUnderMenu from './UnderBarSelect';


const rootReducer = combineReducers({
  SelectMenu,
  SelectUnderMenu,
});


export default rootReducer;
